    false,nt"url": null,nt"notes": "NODC Accession 0130850 includes chemical,
    optical and physical data collected aboard the MELVILLE during cruise MV1103 in
    the South Pacific Ocean from 2011-03-15 to 2011-03-20. These data include Attenuation/Transmission,
    CONDUCTIVITY, DEPTH - BOTTOM, DEPTH - OBSERVATION, DISSOLVED OXYGEN, HYDROSTATIC
    PRESSURE, SALINITY, WATER TEMPERATURE and surface irradiance. The instruments used
    to collect these data include CTD, PAR Sensor, echo sounder, oxygen meter and transmissometer.
    These data were collected by David Chadwell of University of California - San Diego;
    Scripps Institution of Oceanography as part of Chilean Earthquake Rupture Survey
    (CERS). The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NODC
    as part of the NSF sponsored Rolling Deck to Repository (R2R) program.The CTD data
    submitted by the originator represent the raw data suite. Processed versions of
    the data were generated by NODC.",nt"owner_org": "9cda5205-d632-4814-96e7-a4ab5e0dce85",nt"extras":
